import React from "react";
import Aside from "./Aside";
import {
    BrowserRouter as Router,
    Switch,
    Route
} from "react-router-dom";
import Home from "../ComponentLink/Home";
import AboutMe from "../ComponentLink/AboutMe"


const Main = () => {
    return (
        <div className="main-div">
            <Router>
                <Aside />

                <Switch>
                    <Route path="/">
                        <Home />
                    </Route>
                    {/* <Route path="/home">
                        <Home />
                    </Route> */}
                    <Route path="/about_me">
                        <AboutMe />
                    </Route>
                </Switch>
            </Router>

        </div>
    )
}

export default Main
